import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer } from 'recharts';

const StudentProfile = () => {
  const [student, setStudent] = useState(null);
  const [predictions, setPredictions] = useState([]);

  useEffect(() => {
    // Mock student ID, in real app get from auth
    const studentId = 1;
    
    // Fetch student data
    axios.get(`http://localhost:8000/api/students/${studentId}`)
      .then(response => setStudent(response.data))
      .catch(error => console.error('Error fetching student:', error));
    
    // Fetch predictions
    axios.get(`http://localhost:8000/api/predictions/history/${studentId}`)
      .then(response => setPredictions(response.data))
      .catch(error => console.error('Error fetching predictions:', error));
  }, []);

  if (!student) return <div>Loading...</div>;

  const chartData = [
    { subject: 'Math', score: student.internal_marks },
    { subject: 'Science', score: student.assignment_scores },
    { subject: 'English', score: student.lab_performance },
  ];

  return (
    <div className="container mx-auto p-6">
      <h1 className="text-3xl font-bold mb-6">Student Profile</h1>
      
      <div className="bg-white p-6 rounded-lg shadow-md mb-6">
        <h2 className="text-xl font-semibold mb-4">Personal Information</h2>
        <div className="grid grid-cols-2 gap-4">
          <p><strong>Name:</strong> {student.name}</p>
          <p><strong>Email:</strong> {student.email}</p>
          <p><strong>Major:</strong> {student.major}</p>
          <p><strong>Enrollment Year:</strong> {student.enrollment_year}</p>
        </div>
      </div>

      <div className="bg-white p-6 rounded-lg shadow-md mb-6">
        <h2 className="text-xl font-semibold mb-4">Academic Performance</h2>
        <div className="grid grid-cols-2 md:grid-cols-4 gap-4 mb-4">
          <div className="text-center">
            <p className="text-2xl font-bold text-blue-600">{student.attendance_percentage}%</p>
            <p>Attendance</p>
          </div>
          <div className="text-center">
            <p className="text-2xl font-bold text-green-600">{student.previous_gpa}</p>
            <p>Previous GPA</p>
          </div>
          <div className="text-center">
            <p className="text-2xl font-bold text-purple-600">{student.study_hours}</p>
            <p>Study Hours/Week</p>
          </div>
          <div className="text-center">
            <p className="text-2xl font-bold text-orange-600">{student.participation_metrics}%</p>
            <p>Participation</p>
          </div>
        </div>
        
        <ResponsiveContainer width="100%" height={300}>
          <BarChart data={chartData}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="subject" />
            <YAxis />
            <Tooltip />
            <Bar dataKey="score" fill="#8884d8" />
          </BarChart>
        </ResponsiveContainer>
      </div>

      <div className="bg-white p-6 rounded-lg shadow-md">
        <h2 className="text-xl font-semibold mb-4">Prediction History</h2>
        {predictions.length > 0 ? (
          <div className="space-y-4">
            {predictions.map(pred => (
              <div key={pred.id} className="border p-4 rounded">
                <p><strong>Predicted Performance:</strong> {pred.predicted_performance}</p>
                <p><strong>Risk Score:</strong> {pred.risk_score.toFixed(2)}</p>
                <p><strong>Recommendations:</strong> {JSON.parse(pred.recommendations).join(', ')}</p>
                <p><strong>Date:</strong> {new Date(pred.created_at).toLocaleDateString()}</p>
              </div>
            ))}
          </div>
        ) : (
          <p>No predictions available.</p>
        )}
      </div>
    </div>
  );
};

export default StudentProfile;
